// @ts-check
const sqlite3 = require('sqlite3').verbose();
const md5 = require('md5');
const fs = require('fs');
const { Database } = require('sqlite3');

// Config
const primaryDBPath = './bin/db/main.db';

/**
 * @type { import('sqlite3').Database }
 */
var primaryDB = null;


/* -------------------------------------------------------------------------- */
/*                                 Primary DB                                 */
/* -------------------------------------------------------------------------- */
const initPrimaryDB = () => {
    let newInstance = !fs.existsSync(primaryDBPath);
    primaryDB = new sqlite3.Database(primaryDBPath,
        sqlite3.OPEN_READWRITE | sqlite3.OPEN_CREATE, 
        (err) => {
            if(err){
                console.log(err)
            }else{
                if(newInstance){
                    _createPrimaryDBTable()
                }
            }
        }
    );
}

const getPrimaryDB = () => {
    return primaryDB
};

const _createPrimaryDBTable = () => {
    primaryDB.serialize(() => {
        primaryDB.run('CREATE TABLE IF NOT EXISTS users(username text, password text, created_time timestamp)'); 
    })
}


