/**
 * 
 * @param {Database} db2 
 */
const resetSecondaryDB = (db2) => {
    _initSecondaryDB(db2);
}

/**
 * 
 * @param {String} username 
 * @returns { import('sqlite3').Database }
 */
const getSecondaryDB = (username) => {
    let code = md5(username)
    let dbPath = `./bin/db/${code}.db`

    let newInstance = !fs.existsSync(dbPath)
    let database = new sqlite3.Database(dbPath, (err) => {
        if(err){
            console.log(err)
        }else{
            if(newInstance){
                _initSecondaryDB(database)
            }        
        }
    })

    return database
}

module.exports = {
    getPrimaryDB : getPrimaryDB,
    initPrimaryDB : initPrimaryDB,
    getSecondaryDB : getSecondaryDB,
    resetSecondaryDB : resetSecondaryDB
};